def find_overlaps(large_range, ranges):
    overlaps = []
    for r in ranges:
        if r[1] >= large_range[0] and r[0] <= large_range[1]:
            start = max(r[0], large_range[0])
            end = min(r[1], large_range[1])
            overlaps.append((start, end))
    return overlaps

